  width: 80%;
  min-height: 400px;
  border-radius: 25px;
  background-color: lightgrey;
  display: flex;
  margin: auto;
  margin-top: 50px;
  justify-content: space-around;
  flex-wrap: wrap;
  margin-bottom: 50px;
`;

export default function CardContainer() {
  React.useEffect(() => {
    axios.get("./data/logements.json").then((res) => {
      setLogementsData(res.data);
      setLoading(false);
    });
  }, [setLogementsData]);

  return (
    <StyledBackground>
      <Card />
      <Card />
      <Card />
      <Card />
      <Card />
      <Card />
    </StyledBackground>
  );
}
